export class WelcomeContainer extends Component {
    render() {
        return (
            <div>
<Link to ="/login"><Button>Log in</Button></Link>
<Link to ="/signup"><Button>Sign up</Button></Link>
</div>
        );
    }
}

export default WelcomeContainer;
